#include "texture.h"

uint32_t* convertARGBtoRGBATexture(const uint32_t* src, int numPixels) {
    uint32_t* dst = malloc(numPixels * sizeof(uint32_t));
    for (int i = 0; i < numPixels; i++) {
        uint32_t argb = src[i];
        uint8_t a = (argb >> 24) & 0xFF;
        uint32_t rgb = argb & 0x00FFFFFF;
        dst[i] = (rgb << 8) | a;
    }
    return dst;
}

